       // Display total babysteps since last G28","","  //#define BABYSTEP_ZPROBE_OFFSET          // Combine M851 Z and Babystepping","  #if ENABLED(BABYSTEP_ZPROBE_OFFSET)","    //#define BABYSTEP_HOTEND_Z_OFFSET      // For multiple hotends, babystep relative Z offsets","    //#define BABYSTEP_ZPROBE_GFX_OVERLAY   // Enable graphical overlay on Z-offset editor","  #endif","#endif","","// @section extruder","","/**"," * Linear Pressure Control v1.5"," *"," * Assumption: advance [steps] = k * (delta velocity [steps/s])"," * K=0 means advance disabled."," *"," * NOTE: K values for LIN_ADVANCE 1.5 differ from earlier versions!"," *"," * Set K around 0.22 for 3mm PLA Direct Drive with ~6.5cm between the drive gear and heatbreak."," * Larger K values will be needed for flexible filament and greater distances."," * If this algorithm produces a higher speed offset than the extruder can handle (compared to E jerk)"," * print acceleration will be reduced during the affected moves to keep within the limit."," *"," * See https://marlinfw.org/docs/features/lin_advance.html for full instructions."," */","#define LIN_ADVANCE","#if ENABLED(LIN_ADVANCE)","  #if ENABLED(DISTINCT_E_FACTORS)","    #define ADVANCE_K { 0.0 }     // (mm) Compression length per 1mm/s extruder speed, per extruder","  #else","    #define ADVANCE_K 0.0         // (mm) Compression length applying to all extruders","  #endif","  //#define ADVANCE_K_EXTRA       // Add a second linear advance constant, configurable with M900 L.","  //#define LA_DEBUG              // Print debug information to serial during operation. Disable for production use.","  #define EXPERIMENTAL_SCURVE     // Allow S-Curve Acceleration to be used with LA.","  //#define ALLOW_LOW_EJERK       // Allow a DEFAULT_EJERK value of \u003c10. Recommended for direct drive hotends.","  //#define EXPERIMENTAL_I2S_LA   // Allow I2S_STEPPER_STREAM to be used with LA. Performance degrades as the LA step rate reaches ~20kHz.","#endif","","// @section leveling","","/**"," * Use Safe Bed Leveling coordinates to move axes to a useful position before bed probing."," * For example, after homing a rotational axis the Z probe might not be perpendicular to the bed."," * Choose values the orient the bed horizontally and the Z-probe vertically."," */","//#define SAFE_BED_LEVELING_START_X 0.0","//#define SAFE_BED_LEVELING_START_Y 0.0","//#define SAFE_BED_LEVELING_START_Z 0.0","//#define SAFE_BED_LEVELING_START_I 0.0","//#define SAFE_BED_LEVELING_START_J 0.0","//#define SAFE_BED_LEVELING_START_K 0.0","//#define SAFE_BED_LEVELING_START_U 0.0","//#define SAFE_BED_LEVELING_START_V 0.0","//#define SAFE_BED_LEVELING_START_W 0.0","","/**"," * Points to probe for all 3-point Leveling procedures."," * Override if the automatically selected points are inadequate."," */","#if EITHER(AUTO_BED_LEVELING_3POINT, AUTO_BED_LEVELING_UBL)","  //#define PROBE_PT_1_X 15","  //#define PROBE_PT_1_Y 180","  //#define PROBE_PT_2_X 15","  //#define PROBE_PT_2_Y 20","  //#define PROBE_PT_3_X 170","  //#define PROBE_PT_3_Y 20","#endif","","/**"," * Probing Margins"," *"," * Override PROBING_MARGIN for each side of the build plate"," * Useful to get probe points to exact positions on targets or"," * to allow leveling to avoid plate clamps on only specific"," * sides of the bed. With NOZZLE_AS_PROBE negative values are"," * allowed, to permit probing outside the bed."," *"," * If you are replacing the prior *_PROBE_BED_POSITION options,"," * LEFT and FRONT values in most cases will map directly over"," * RIGHT and REAR would be the inverse such as"," * (X/Y_BED_SIZE - RIGHT/BACK_PROBE_BED_POSITION)"," *"," * This will allow all positions to match at compilation, however"," * should the probe position be modified with M851XY then the"," * probe points will follow. This prevents any change from causing"," * the probe to be unable to reach any points."," */","#if PROBE_SELECTED \u0026\u0026 !IS_KINEMATIC","  //#define PROBING_MARGIN_LEFT PROBING_MARGIN","  